$(document).ready(function ($) {

    var h = $('.card.post-image img').height();
    $('.card.post-image').css('max-height', h);
    $(window).resize(function () {
        var h = $('.card.post-image img').height();
        $('.card.post-image').css('max-height', h);
        if ($(window).width() > 768) {
            $('#mainhead').removeAttr("style");
            $('#main').removeAttr("style");
        }
    });


    var previousScroll = 0;
    $(window).scroll(function (event) {
        var scroll = $(this).scrollTop();
        var mm = $('#main-menu');
        var he = $('.site-header').outerHeight() + mm.outerHeight() + 250;
        if (mm.hasClass('is_sticky')) {
            if ($(window).width() > 768) {
                if (scroll > he) {
                    $('.site-header').css("padding-bottom", mm.outerHeight());
                    mm.addClass('sticky');
                    if (scroll > previousScroll) {
                        mm.css("top", '-100%');
                    } else {
                        mm.css("top", 0);
                    }
                } else {
                    $('.site-header').css("padding-bottom", 0);
                    mm.css("top", '-100%');
                    mm.delay(1000).removeClass('sticky').removeAttr("style");

                }
            }
            previousScroll = scroll;
        }

    });


    $(".icon-close").click(function () {
        $("#notification").slideUp(800);
    });

    $("#notification").slideDown(800);

    $(".notifi-clos").click(function () {
        var note = $(this).attr("data-removed");
        var path = $(this).attr("data-path");
        document.cookie = "wf_notification=" + note + "; path=/;";
        $("#notification").slideUp(800);
        setTimeout(function () {
            $("#notification").remove()
        }, 1000);

    });
    $("#btn-copy-link").click(function () {
        $("#input-post-link").select();
        document.execCommand('copy');

    });

    $("#btn-copy-pass").click(function () {
        $("#input-pass").select();
        document.execCommand('copy');

    });

    $(".burger-container").click(function () {
        if ($("#mainhead").hasClass('menu-opened')) {
            $("#mainhead").removeClass('menu-opened');
            $(".mobilenav").removeClass('active');
            $(".screen_mobile_show").removeAttr("style");
        } else {
            $(".mobilenav").addClass('active');
            $("#mainhead").addClass('menu-opened');
            $(".screen_mobile_show").css({
                "visibility": "visible",
                "opacity": "1"
            });
        }
    });

    $(".screen_mobile_show").click(function () {
        if ($("#mainhead").hasClass('menu-opened')) {
            $("#mainhead").removeClass('menu-opened');
            $(".mobilenav").removeClass('active');
            $(".screen_mobile_show").removeAttr("style");
        }
    });


    $(window).scroll(function () {
        var logoof = $('.logo').offset();
        var mtop = $('#mainhead').height() + 24;
        var logosc = logoof + 150;
        if ($(window).width() < 768) {
            if ($(this).scrollTop() > 350) {
                $('#main').attr('style', 'margin-top: ' + mtop + 'px !important');
                $('#mainhead').css({
                    "position": "fixed",
                    "top": "0px",
                    "width": "100%",
                    "z-index": "99999",
                    "background": "#fff",
                    "box-shadow": "0px 0px 9px rgba(0, 0, 0, 0.10)",
                    "transition": "all .3s ease-in-out"
                });
            } else {
                $('#mainhead').removeAttr("style");
                $('#main').removeAttr("style");
            }
        }
        var p = $('#sidbar_product');
        var s = $('.sidbar');
        var a = $('#product-adtocart');
        if (p.length) {
            var t = p.offset();
            var h = p.height();
            var w = p.width();
            var sidheight = s.height();
            var sidoff = s.offset();
            var toppx = sidheight + sidoff.top - a.height() - 100;
            var tot = t.top + h;
            if ($(this).scrollTop() > tot) {
                if ($(this).scrollTop() > toppx) {
                    a.removeAttr("style");
                    a.css({
                        "position": "absolute",
                        "bottom": "0",
                        "width": w,
                        "transition": "all .3s ease-in-out"
                    });

                } else {
                    a.css({
                        "position": "fixed",
                        "top": "40px",
                        "width": w,
                        "bottom": 'unset',
                        "transition": "all .5s ease-in"
                    });
                }

            } else {
                a.removeAttr("style");
            }
        }

    });

    $(".btnmenuprofile").click(function () {
        if ($(".panel-menu").hasClass('opened')) {
            $(".panel-menu").slideUp(400);
            $(this).removeClass('active');
            $(".panel-menu").removeClass('opened');
        } else {
            $(this).addClass('active');
            $(".panel-menu").addClass('opened');
            $(".panel-menu").slideDown(400);
        }
    });

    $('.mobile-menu li.menu-item-has-children>a').prepend('<i class="dropdown-toggle-menu"></i>');

    $(".mobile-menu li.menu-item-has-children>a>i").click(function (e) {
        e.preventDefault();
        var li = $(this).parent().parent('.menu-item-has-children');
        var a = $(this).parent();
        if ($(li).children('.sub-menu').hasClass('opened')) {
            $(li).children('.sub-menu').slideUp(400);
            $(a).removeClass('active');
            $(li).children('.sub-menu').removeClass('opened');
        } else {
            $(a).addClass('active');
            $(li).children('.sub-menu').addClass('opened');
            $(li).children('.sub-menu').slideDown(400);
        }
    });

    function showNavigation() {
        var x = $(".btnmenu");
        if (x.hasClass('active')) {
            x.style.display = "none";
        } else {
            x.addClass('active');
        }
    }

    $('#registerbtn-modal').click(function () {
        $('a.nav-link[href="#register-tab"]').tab('show');
    });

    $('#loginbtn-modal').click(function () {
        $('a.nav-link[href="#login-tab"]').tab('show');
    });
    $(window).scroll(function () {
        if ($(this).scrollTop() > 100) {
            $('.scroll-top').fadeIn();
        } else {
            $('.scroll-top').fadeOut();
        }
    });

    $('.scroll-top').click(function () {
        $("html, body").animate({
            scrollTop: 0
        }, 400);
        return false;
    });
    $(document).on('click', '.sl-button', function () {
        var button = $(this);
        var post_id = button.attr('data-post-id');
        var security = button.attr('data-nonce');
        var iscomment = button.attr('data-iscomment');
        var allbuttons;
        if (iscomment === '1') { /* Comments can have same id */
            allbuttons = $('.sl-comment-button-' + post_id);
        } else {
            allbuttons = $('.sl-button-' + post_id);
        }

        var loader = allbuttons.next('#s-loader');
        if (post_id !== '') {
            $.ajax({
                type: 'POST',
                url: factshop.ajaxurl,
                data: {
                    action: 'process_simple_like',
                    post_id: post_id,
                    nonce: security,
                    is_comment: iscomment,
                },
                beforeSend: function () {

                    button.fadeOut(0);
                    loader.css('display', 'inline-block');
                    loader.delay(200).html('&nbsp;<div class="sloader">Loading...</div>');
                },
                success: function (response) {
                    var icon = response.icon;
                    var count = response.count;
                    allbuttons.html(icon + count);
                    if (response.status === 'unliked') {
                        var like_text = factshop.like;
                        allbuttons.prop('title', like_text);
                        allbuttons.removeClass('liked');
                    } else {
                        var unlike_text = factshop.unlike;
                        allbuttons.prop('title', unlike_text);
                        allbuttons.addClass('liked');
                    }
                    loader.delay(200).empty();
                    loader.css('display', 'none');
                    button.fadeIn(0);
                }
            });

        }
        return false;
    });

    function readURL(input) {
        if (input.files && input.files[0]) {
            var reader = new FileReader();
            reader.onload = function (e) {
                $('.image-avatar-background').css('background-image', 'url(' + e.target.result + ')');
                $('.image-avatar-background').hide();
                $('.image-avatar-background').fadeIn(650);
                $('#imagePreview').css('background-image', 'url(' + e.target.result + ')');
                $('#imagePreview').hide();
                $('#imagePreview').fadeIn(650);
                $('#btn-submit-avatar').prop("disabled", false);
            }
            reader.readAsDataURL(input.files[0]);
        }
    }

    $("#imageUpload").change(function () {
        readURL(this);
    });
    if ($(window).width() > 1000) {
        $(".sticky-sidbar").stick_in_parent({
            offset_top: 10
        });
    }

});

(function ($) {
    $(document).ready(function () {
        var r = $('.ajax-results');
        var s = $('.ajax-search');
        var l = $('#s-loader.search-ajax-loader');

        function dosearch(t) {
            $.ajax({
                type: 'post',
                url: factshop.ajaxurl, // the localized name of your file
                data: {
                    action: 'factshop_live_search', // the wp_ajax_ hook name
                    search: t
                },
                success: function (result) {
                    l.removeAttr("style");
                    if (result === 'error') {
                        r.addClass('no-results');
                        r.html('چیزی پیدا نشد');
                    } else {
                        r.removeClass('no-results');
                        r.html(result);
                    }
                }
            });
        }

        var thread = null;
        s.focusout(function () {
            r.fadeOut(100);
        });
        s.focus(function () {
            r.fadeIn(100);
        });
        s.keyup(function () {
            r.fadeIn(100);
            l.css({
                'opacity': '1',
                'visibility': 'visible',
            });
            clearTimeout(thread);
            var $this = $(this);
            thread = setTimeout(
                function () {
                    dosearch($this.val())
                },
                1000
            );
        });

    });

})(jQuery);
